// frontend/src/pages/HomePage.js
import React, { useEffect, useState } from 'react';
import { Container, Row, Col, Carousel, Button, Spinner, Alert } from 'react-bootstrap';
import axios from 'axios';
import Product from '../components/Product';

const HomePage = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading]   = useState(true);
  const [error, setError]       = useState(null);

  useEffect(() => {
    let mounted = true;
    (async () => {
      try {
        const { data } = await axios.get('/api/products/');
        if (mounted) setProducts((data || []).slice(0, 8)); // show first 8 as “featured”
      } catch (e) {
        if (mounted) setError(e?.response?.data?.detail || e.message);
      } finally {
        if (mounted) setLoading(false);
      }
    })();
    return () => { mounted = false; };
  }, []);

  return (
    <>
      {/* Hero */}
      <Carousel fade interval={5000} pause="hover">
        <Carousel.Item>
          <img className="d-block w-100" src="/hero/slide1.jpg" alt="Banner 1" style={{maxHeight:520, objectFit:'cover'}}/>
          <Carousel.Caption>
            <h2>Hydration • Radiance • Innovation</h2>
            <p>Curated Korean cosmetics delivered across Morocco.</p>
            <Button variant="light" href="/products">Discover our products</Button>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src="/hero/slide2.jpg" alt="Banner 2" style={{maxHeight:520, objectFit:'cover'}}/>
          <Carousel.Caption>
            <h2>Brands you’ll love</h2>
            <Button variant="light" href="/products">Shop now</Button>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src="/hero/slide3.jpg" alt="Banner 3" style={{maxHeight:520, objectFit:'cover'}}/>
          <Carousel.Caption>
            <h2>Glow starts here ✨</h2>
            <Button variant="light" href="/products">Browse</Button>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>

      {/* Intro */}
      <Container className="py-5 text-center">
        <h3 className="mb-3">Welcome to Your K-Beauty Shop</h3>
        <p className="text-muted">
          Safe, effective routines for hydration, brightening and barrier repair — shipped fast.
        </p>
      </Container>

      {/* Featured */}
      <Container className="pb-5">
        <Row className="align-items-center mb-3">
          <Col><h4 className="m-0">Featured this week</h4></Col>
          <Col className="text-right"><Button variant="outline-secondary" size="sm" href="/products">See all</Button></Col>
        </Row>

        {loading && <div className="d-flex justify-content-center py-5"><Spinner animation="border" /></div>}
        {error && <Alert variant="danger">{error}</Alert>}

        <Row>
          {products.map(p => (
            <Col key={p.id} xs={12} sm={6} md={4} lg={3} className="mb-4">
              {/* Reuse your existing product card */}
              <Product product={p} />
            </Col>
          ))}
          {!loading && !error && products.length === 0 && (
            <Col className="text-center text-muted py-5">No featured products yet.</Col>
          )}
        </Row>
      </Container>
    </>
  );
};

export default HomePage;
